import React from 'react'
import "../Style/Footer.css"

function Footer() {
  return (
    <div className='Footer'>
      <h1>website is one that allows people to buy and sell physical goods, services, and digital products over the internet rather than at a brick-and-mortar location</h1>
      <br/>
      Email at @pallabee1996@gmail.com
    </div>
  )
}

export default Footer
